e.exports=JSON.parse('{"sections":{"360009069551":{"name":"Deneyimini Kontrol Etmek","description":"Bu kaynaklar, Discord deneyiminden en iyi şekilde faydalanman için sana yardımcı olur. Hesap ipuçlarından sunucu yönetimine veya Güvenlik Ekibine direkt ihbar bildirimine kadar her şeyi kapsamlı olarak ele aldık."},"360009069571":{"name":"Ebeveynler & Eğitimciler","description":"Gelişim çağındaki gençler ve öğrenciler Discord üzerinden iletişim kurmakta oldukça hevesli, bu da ebeveynler ve eğitimcilerin sorularına yol açabilir. Buradan Discod\'u sınıf olarak kullanan gençlere yönelik ipuçları bulabilirsin."},"360008956792":{"name":"Nasıl Yaptırım Uygularız","description":"Bu makaleler Discord\'da değişik durumlara nasıl yaklaştığımıza açıklık getirir; nasıl araştırma yaptığımızdan güvenlik güçleri gibi üçüncül kaynaklarla nasıl çalıştığımıza kadar. Ayrıca buradan yıllık şeffaflık raporumuza ulaşabilirsin."}},"articles":{"360043709612":"Politikalarımız","360044149331":"Discord Nedir? ","360043857751":"Süper güvenli bir hesap için dört adım ","360044158971":"Kurallarımızı uygulamak","360043700632":"Discord\'un güvenli ve güvenilebilir bir deneyime olan bağlılığı","360043653152":"Süper güvenli bir sunucu için dört adım ","360043712132":"Nasıl Araştırıyoruz","360044153831":"Çocuklarınızın Discord\'da güvende olmalarına yardımcı olmak","360044103531":"Discord’da adminlerin ve moderatörlerin rolü","360044159011":"Ne tür önlemler alıyoruz","360044154611":"Çocuğunuzla çevrimiçi güvenlik hakkında konuşmak","360044103651":"Discord’a Sorunları İletmek","360043712172":"Müdahalelerimize nasıl itirazda bulunabilirsiniz ","360044149591":"Ebeveynlerin ve eğitimcilerin en önemli sorularına cevaplar","360044103771":"Discord’da Zihin Sağlığı","360043712232":"Discord\'un Şeffaflık Raporu","360044154771":"Eğer çocuğunuz bir sorunla karşılaşırsa","360043653552":"Discord’da Yetişkin İçerik","360044157931":"Emniyet birimleri ile çalışmak ","360044104071":"Spam ve Hacklemeye Karşı Tavsiyeler"}}')
