e.exports=JSON.parse('{"sections":{"360009069551":{"name":"如何掌控您的體驗","description":"這裡的資源將幫助您了解您該如何創造在Discord的最佳體驗。 這包括了所有您能在Discord上看見的內容，比如帳號以及伺服器的管理訣竅，以及在遇到問題時向我們的「信任與安全」尋求幫助的正確方法。"},"360009069571":{"name":"致父母與教育者","description":"我們知道很多青少年以及學生對於能在Discord上進行交流感到格外興奮。同時也了解這或許會讓家長及教育者擔心是否有不好的影響。因此，我們列出了一些小撇步，讓您了解該如何運用Discord的教室功能在孩子身上。"},"360008956792":{"name":"我們如何執行制裁","description":"這些文章能幫助您理解我們一般是如何解決Discord上發生的各種情況的。這涵蓋了我們如何調查案件，以及與第三方單位（比如執法單位）的合作方式。同時您可以在這裏找到我們完全透明的年度報告書。"}},"articles":{"360043709612":"Discord的政策","360044149331":"Discord是什麼? ","360043857751":"建立超級安全帳戶的4個步驟","360044158971":"遵守在Discord上的規定","360043700632":"Discord對安全與值得信賴的體驗的承諾","360043653152":"建立超級安全伺服器的4個步驟","360043712132":"收到舉報後我們如何進行調查","360044153831":"幫助您的孩子安全使用Discord","360044103531":"管理者和版主在Discord上扮演的角色","360044159011":"我們如何採取措施","360044154611":"與孩子談論在線安全","360044103651":"向Discord檢舉違規行為","360043712172":"您如何對我們的處置提出上訴","360044149591":"給父母和教育者的問與答","360044103771":"心理健康問題","360043712232":"Discord 的透明度報告","360044154771":"如果您的孩子遇到問題","360043653552":"Discord上的成人內容","360044157931":"與執法單位合作","360044104071":"預防垃圾訊息和駭客的技巧"}}')
